from axiestudio import CustomComponent
from langchain.schema import Document

import os
import json


class CSVSaver(CustomComponent):
    display_name: str = "JSON Saver"
    description: str = "Saves dictionaries in JSON files"

    def build_config(self):
        return {}

    def build(self, documents: Document) -> Document:
        for doc in documents:
            data = json.loads(doc[8:-3]) # to remove quotes like: ```json{}```


            with open(data['name'] + ".json", "w") as file:
                json.dump(data, file)

        return True

